const videos = [
{
    name: '1',
    duration: 15,
    id: 1, 
},
{
    name: '2',
    duration: 15,
},
{
    name: '3',
    duration: 15,
}
]
export function VideoList(){
    return (
        <>
        <h1>VideoList</h1>
        {
            videos.map((video) => {
                return (
                    <div>
                        <p>{video.name}</p>
                        <p>{video.duration}</p>
                        <button>Like</button>
                    </div>
                )
            })
        }
        </>
    )
}
